          </button>
        </div>
        <div className="ProductList-details-picture col-md-6">
          <img
            src="./images/ProductList-pictures/always-happy.jpeg"
            alt="happy-woman"
          ></img>
        </div>
      </section>
      <section className="ProductList-details m-3 p-3 d-flex flex-row ">
        <div className="ProductList-details-picture col-md-6">
          <img
            src="./images/ProductList-pictures/shine-bright.jpeg"
            alt="happy-woman"
          ></img>
        </div>

